import {Link} from 'react-router-dom';
import {useEffect, useState} from 'react';
import axios from 'axios';

const baseUrl='http://127.0.0.1:8000/api/user/';
function UserSignup() {

  useEffect(()=>{
    document.title='User Sign UP';
  });

  const [userData, setUserData] = useState({
    'full_name': '',
    'email': '',
    'password': '',
    'username': '',
    'interested_categories': '',
    'profile_img':'',
    'status': '',
    'otp_digit':''
  });

  //Change Element Value
  const handleChange=(event)=>{
    setUserData({
      ...userData,
      [event.target.name]: event.target.value
    });
  }
  //End

  //Submit Form
  const submitForm = () => {
    const otp_digit = Math.floor(100000 + Math.random() * 900000);
    const userFormData = new FormData();
  
    userFormData.append("full_name", userData.full_name);
    userFormData.append("email", userData.email);
    userFormData.append("password", userData.password);
    userFormData.append("username", userData.username);
    userFormData.append("interested_categories", userData.interested_categories);
  
    // Create a new XMLHttpRequest to load the image from the URL
    const xhr = new XMLHttpRequest();
    xhr.open("GET", "https://t4.ftcdn.net/jpg/05/50/60/55/360_F_550605549_PaTP81pjaCsrNTnfUaYlUZ8wmPpQSHY8.jpg");
    xhr.responseType = "blob";
    xhr.onload = function () {
      // Convert the response to a File object
      const file = new File([xhr.response], "image.jpg", {
        type: xhr.response.type,
      });
  
      // Append the File object to the FormData object
      userFormData.append("profile_img", file);
      userFormData.append("otp_digit", otp_digit);
  
      // Submit the form data
      axios.post(baseUrl, userFormData).then((response) => {
        window.location.href = "/user-verify/" + response.data.id;
        //setUserData({
        //  'full_name': '',
        //  'email': '',
        //  'password': '',
        //  'username': '',
        //  'interested_categories': '',
        //  'status': 'success'
        //});
      });
    };
    xhr.send();
  
    try {
      // Catch errors here
    } catch (error) {
      console.log(error);
      setUserData({ status: "error" });
    }
  };
  
  //End

  return (
    <> 
        {/* Left Part */}
       <div className="leftSide"></div>
        
        {/* Right Part */}
       <div className="rightSide">
         {/*userData.status ==='success' && <p className="text-success">Сәтті тіркелдіңіз!</p>*/}
         {/*userData.status ==='error' && <p className="text-danger">Тіркелу мүмкін емес, тағы да байқап көріңіз!</p>*/}
         <Link to="/"><p className="logo" >lulu school</p></Link>
         <div id = "register-info">
         <h3>Аккаунтқа тіркелу</h3>

           <div className="form-group">
             <input name="full_name" value={userData.full_name} onChange={handleChange} type="text" className="form-control" id="InputUsername1" aria-describedby="emailHelp" placeholder="Толық аты - жөні"></input>
           </div>

           <div className="form-group">
             <input name="email" value={userData.email} onChange={handleChange} type="email" className="form-control" id="InputEmail1" aria-describedby="emailHelp" placeholder="Электрондық пошта"></input>
           </div>

           <div className="form-group">
             <input name="username" value={userData.username} onChange={handleChange} type="text" className="form-control" id="Inputusername1" aria-describedby="emailHelp" placeholder="Қолданушы аты"></input>
           </div>

           <div className="form-group">
             <input name="password" value={userData.password} onChange={handleChange} type="password" className="form-control" id="InputPassword1" placeholder="Құпия сөз"></input>
           </div>

           <div className="form-group">
             <textarea name="interested_categories" value={userData.interested_categories} onChange={handleChange} type="text" className="form-control" id="Inputinterest" aria-describedby="emailHelp" placeholder="Қызығушылығы"></textarea>
           </div>
           
           <div className="form-group">
             <button onClick={submitForm} type="submit">Тіркелу</button>
           </div>

         <p id="bottom-words">Тіркеліп қойдыңыз ба? <Link to="/user-login" id="a">Кіру</Link></p>
         </div>
         </div>

    </>
  );
}

export default UserSignup;
